CREATE TABLE citizenship_ceremonies (
    ceremony_id INT PRIMARY KEY,
    ceremony_date DATE,
    ceremony_location VARCHAR(255),
    attendee_id INT
);

CREATE TABLE attendees (
    attendee_id INT PRIMARY KEY,
    attendee_name VARCHAR(255),
    attendee_age INT,
    ceremony_id INT
);

CREATE TABLE citizenship_ceremonies (
    ceremony_id UUID PRIMARY KEY,
    ceremony_date DATE,
    location VARCHAR,
    attendee_name VARCHAR
);

CREATE TABLE ceremony_attendees (
    attendee_id UUID PRIMARY KEY,
    attendee_name VARCHAR,
    ceremony_id UUID
);

CREATE TABLE ceremony_locations (
    location_id UUID PRIMARY KEY,
    location_name VARCHAR,
    city VARCHAR,
    state VARCHAR
);

CREATE TABLE ceremony_dates (
    date_id UUID PRIMARY KEY,
    ceremony_id UUID,
    ceremony_date DATE
);
